css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("feedly.com") {

/* latin */
@font-face {
  font-family: 'Anonymous Pro';
  font-style: normal;
  font-weight: 400;
  src: local('Anonymous Pro'), local('AnonymousPro'),        url("data:font/woff2;base64,") format('woff2');
}
 
/* latin */
@font-face {
  font-family: 'Belgrano';
  font-style: normal;
  font-weight: 400;
  src: local('Belgrano'), local('Belgrano-Regular'), 
url("data:font/woff2;base64,") format('woff2');
}

.u100Frame {
  background-color:#fff;
  }

.u100Frame .entryBody > p,
.u100Frame .entryBody > div
{
   font-size:120% !important;
   font-family: "Belgrano";
}

.u100Frame .entryBody > pre,
.u100Frame .entryBody > p pre,
.u100Frame .entryBody > div pre
{
  background: #dadada;
  border-radius:10px;
  margin:5px;
  padding:5px 10px;
  font-family:'Anonymous Pro', monospace;
}

.u100Frame figcaption {
  text-align:center;
  font-size:80%;
  color:#444;
  margin-top:-15px;
  }
.u100Frame p img,
.u100Frame div img
{
    text-align:center;
    margin:0 auto;
    padding:4px;
    border:1px solid #dadada;
  }

.u100Frame.selectedEntry {
  box-shadow:0 0 20px rgba(0,0,0, 0.6);
}
  
.u100Entry .title {
   font-family: "Belgrano"!important;
   font-size:300% !important;
   color: #000!important;
   line-height:1.3em !important;
}

.entryBody { max-width:100% !important; }
      
#feedlyFrame {
  background-color:#dadada!important;
}

#feedlyFrame #feedlyTitleBar .hhint { display:none!important; }

#floatingBar {
  background-color:#2d2d2d!important;
  border-bottom:none !important;
}
#floatingBar * { color:#fff!important; }
#floatingBar img { -webkit-filter: invert(100%); }

#feedlyPart { margin-top:-40px!important; }
  #feedlyPageHeader { padding-top:0!important; }

#sideArea { display: none!important; }
#realtimeSign { display:none !important; }
#mainBar {
  width:98% !important;
}
#feedlyPage { width: 98%!important; }
#feedlyPart { width: 98%!important; }
.area { padding: 1%!important; }

.websiteCallForAction { display:none!important; }

.headerInfo {
    border-bottom:none!important;
    height:auto!important;
  }
.headerInfo img { border:none !important; }
}
